import { Col, Container, Row } from "react-bootstrap";
import '../styles/mainStyles.css'

const Home = () =>{

    return(
    <Container>
        <Row>
            <Col>
            <h1>Welcome to Cell Tools!</h1>
            </Col>
        </Row>
    <Row>
        <Col>
        <p>This is the home page.</p>
        </Col>
    </Row>
    </Container>
    )
}

export default Home;
